webpackJsonp([38892885971099],{444:function(e,t){e.exports={data:{markdownRemark:{html:'<p>In this session we plan to have three speakers discuss the topics from SAPUI5, SAP Build and the SAP Business Client</p>\n<p>To attend this event please register via Eventbrite to reserve your place. <strong>( Click on the image below to be redirected to the registration page )</strong></p>\n<p><a href="https://www.eventbrite.com/e/sap-inside-track-brisbane-may-2018-tickets-45431764631"><img src="https://www.eventbrite.com.au/wp-content/themes/core/img/eventbrite-logo.svg" alt="Register Here for SITBNE"></a></p>\n<h1 id="session-overview"><a href="#session-overview" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Session Overview</h1>\n<h2 id="session-1-sap-build-for-rapid-prototyping"><a href="#session-1-sap-build-for-rapid-prototyping" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Session 1: SAP Build for Rapid Prototyping</h2>\n<h3 id="-lachlan-magee---dhs-"><a href="#-lachlan-magee---dhs-" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>( Lachlan Magee - DHS )</h3>\n<p>The discovery stage of a project has the potential to cost or save a lot of money, as changes become much more expensive during and after development. Using rapid prototyping, designers are able to incorporate user feedback, and refine functionality before any development begins; allowing developers to spend more time on quality. For companies heavily invested in SAP, it is worth considering product specific prototyping tools, such as SAP Build. The more focused scope of Build offers a number of advantages over general prototyping tools, with a lot of the leg work being automated or guided. For us, this meant that prototypes could be completed within a day of the initial discussion, and end users\' feedback could be incorporated quickly and easily.</p>\n<h2 id="session-2-demystifying-the-art-of-component-reuse-in-sapui5"><a href="#session-2-demystifying-the-art-of-component-reuse-in-sapui5" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Session 2: Demystifying the art of component reuse in SAPUI5</h2>\n<h3 id="-jakob-kjaer---bourne-digital-"><a href="#-jakob-kjaer---bourne-digital-" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>( Jakob Kjaer - Bourne Digital )</h3>\n<p>Are you tired of reinventing the wheel over and over again? Ever caught yourself copying UI5 applications from one to another? If so, then I\'m here to tell you: "There is a better way". Let me show you how you can do proper component reuse to the extend, where you avoid regression testing, when deploying new apps.</p>\n<h2 id="session-3-sap-business-client-65-and-security"><a href="#session-3-sap-business-client-65-and-security" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Session 3: SAP Business Client 6.5 and Security</h2>\n<h3 id="-colleen-hebbert---independent-sap-security-and-grc-consultant--sap-mentor--scn-moderator--"><a href="#-colleen-hebbert---independent-sap-security-and-grc-consultant--sap-mentor--scn-moderator--" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>( Colleen Hebbert - Independent SAP Security and GRC Consultant / SAP Mentor &#x26; SCN Moderator  )</h3>\n<p>Would you like an End User to tell that they never knew SAP could look so pretty and that they might stop relying on their favourites? </p>\n<p>Well you can actually do this, and it’s not related to HANA, Fiori or Cloud. And how about if I told you that it’s free!!!! We’ll you’re in luck – let’s discuss how security role design can improve the user experience.   </p>',timeToRead:2,excerpt:"In this session we plan to have three speakers discuss the topics from SAPUI5, SAP Build and the SAP Business Client To attend this event…",frontmatter:{title:"May 2018",cover:"../images/Brisbane-Logo-Wheel-City.jpg",date:"2018-05-31",category:"tech",tags:["SAPUI5","SAP Build","SAP Business Client","SAP Security"],author:"jorg"},fields:{slug:"/may-2018"}},prev:{excerpt:"Get in touch with us We'd love to hear from you if you are keen to share something with the community.  Topics…",frontmatter:{title:"Keen to Speak..",cover:"../images/Brisbane-Logo-Wheel-City.jpg",date:"2017-03-17"},fields:{slug:"/keen-to-speak"}},next:{excerpt:"In this session we had three speakers discuss the topics of Workflow on the SAP Cloud Platform, Performance…",frontmatter:{title:"February 2018",cover:"../images/Brisbane-Logo-Wheel-City.jpg",date:"2018-02-22"},fields:{slug:"/february-2018"}},authors:{edges:[{node:{id:"jakob",name:"Jakob Kjaer",image:"https://pbs.twimg.com/profile_images/664612830595813376/gQBGR35i_bigger.jpg",url:"https://sitbne.github.io/",bio:"- Family man - Eternal learner - Design thinking evangelist - Relentless optimist - Developer in disguise"}},{node:{id:"jorg",name:"Jorg Thuijls",image:"https://pbs.twimg.com/profile_images/818736249842192385/sfLdwEYb_bigger.jpg",url:"https://jorg.thuijls.net/",bio:"Developing SAP, front ends and back ends."}},{node:{id:"katan",name:"Katan Patel",image:"https://pbs.twimg.com/profile_images/930008567741947905/AlyYDAjg_bigger.jpg",url:"https://katansapdevelop.github.io/",bio:"SAP Developer & $crypto trader. Loves Coding, cooking, gaming, football, electronic music, MTB & fishing"}},{node:{id:"sitbne",name:"sitbne",image:"https://pbs.twimg.com/profile_images/930008567741947905/AlyYDAjg_bigger.jpg",url:"https://sitbne.github.io/",bio:"Yeah, I like animals better than people sometimes... Especially dogs. Dogs are the best. Every time you come home, they act like they haven't seen you in a year. And the good thing about dogs... is they got different dogs for different people."}}]}},pathContext:{slug:"/may-2018",total:3,prev:"/keen-to-speak",next:"/february-2018"}}}});
